import axios from "axios";

export default class PedidoService {

    path = "/api/pedido/";

    getAll(config) {
        return axios.get(this.path, config);
    }
    save(pedido) {
        return axios.post(this.path, pedido);
    }

    remove(id, config) {
        return axios.delete(`${this.path}${id}`, config);
    }

 
}
